			<div className="card-body">
				<h4>mi titulo</h4>
				<p className="card-text">
					Lorem ipsum dolor sit, amet consectetur adipisicing elit. Distinctio
					cupiditate aspernatur non cumque in natus iure doloribus fugit,
					perferendis tenetur animi amet libero ipsa hic? Labore est in enim
					illum!
				</p>
			</div>

		</div>

	);
}

export default card;
